\nI would like to generate a custom and private sitemap (including also no-index pages) for Cache Preloading.</p>\n<p>Is there a way <strong>to rename the sitemap.xml filename</strong> so that search engines do NOT find my private sitemap. </p>\n<p>Thanks!</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Daniel Zimmermann\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wordpress.org/support/topic/sitemap-urls-blocked-by-robots-txt-file/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Sitemap URLs blocked by robots.txt file\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wordpress.org/support/topic/sitemap-urls-blocked-by-robots-txt-file/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Apr 2018 14:43:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1296:\"\n						\n						<p>Replies: 3</p>\n						<p>I have a new site my company manages that is seeing 4 of these index errors inside of Google Search Console for all parts of its sitemap (the listed link, and 3 others that contain sitemap details), and I can&#8217;t figure out how to alleviate them.</p>\n<p>We are using the Google XML Sitemap Plugin and have the setting &#8220;Add sitemap URL to the virtual robots.txt file&#8221; selected in its settings.</p>\n<p>I&#8217;m wondering if this setting is causing these index errors to occur in our sitemaps, or if it&#8217;s something else. </p>\n<p>I tried changing our robots.txt file to allow everything from all bots, but that didn&#8217;t seem to solve these issues (I did that this morning and then resubmitted the Sitemap through Search Console, but the 4 sitemap index errors still remain). </p>\n<p>I even tried removing the robots.txt file from this site&#8217;s directory entirely, and these 4 errors still remain.</p>\n<p>Do you think this setting is causing the issue, is it the virtual sitemap causing issues (and how do I find and change that if so), or is it something else entirely?</p>\n<p>I&#8217;d like to get this fixed ASAP to avoid any further penalties from Google so any guidance would be greatly appreciated, thanks!</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"mpoepping30\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://wordpress.org/support/topic/google-xml-sitemap-wpseo/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Google XML Sitemap + wpSEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s